import React from "react";
import { NavigationContainer } from "@react-navigation/native";
import { createStackNavigator } from "@react-navigation/stack";
import TaskListPage from "../views/pages/TaskListPage/TaskListPage";
import AddTaskPage from "../views/pages/AddTaskPage/AddTaskPage";

const Stack = createStackNavigator();

export default function Router() {
  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName="Lista de tarefas">
        <Stack.Screen name="Lista de tarefas" component={TaskListPage} />
        <Stack.Screen name="Adicionar tarefa" component={AddTaskPage} />
        <Stack.Screen name="Detalhe da tarefa" component={DetailsTaskPage} />
      </Stack.Navigator>
    </NavigationContainer>
  );
}
